def count_f(num1, num2, array):
    n = 0
    for i in range(0, len(array)-1, 1):
        if array[i] == num1 and array[i+1] == num2:
            n += 1
    return n

def find(num, array):
    if num in array:
        for i in range(len(array)):
            if array[i] == num:
                return i
    else:
        return -1

